    __REAPER1__.F.CleanString = function(str)
        if str:find("'") then
            local a, b = string.find(str, "%b''")
            str = str:sub(a + 1, b - 1)
        elseif str:find('"') then
            local a, b = string.find(str, '%b""')
            str = str:sub(a + 1, b - 1)
        end
        return str
    end

